template <typename T>
class LstmAllocator {
 public:
  LstmAllocator() { }

  virtual ~LstmAllocator() { }

  virtual void AllocateInput() = 0;

  virtual void AllocateOutput() = 0;

  virtual void AllocateParameters() = 0;

  virtual void AllocateGradInput() = 0;

  virtual void AllocateGradOutput() = 0;

  virtual void AllocateGradParameters() = 0;

  virtual void AllocateReserved() = 0;

  virtual void AllocateInferenceWorkspace() = 0;

  virtual void AllocateTrainingWorkspace() = 0;

  virtual const int* InputShape() const = 0;

  virtual T* Input() = 0;

  virtual T* Output() = 0;

  virtual T* Parameters() = 0;

  virtual T* GradInput() = 0;

  virtual T* GradOutput() = 0;

  virtual T* GradParameters() = 0;

  virtual void* Workspace() = 0;

  virtual void* Reserved() = 0;

  virtual const T* OutputHost() const = 0;

  virtual const T* GradInputHost() const = 0;

  virtual const T* GradParametersHost() const = 0;

  virtual const T* ExpectedOutputHost() const;

  virtual const T* ExpectedGradInputHost() const;

  virtual const T* ExpectedGradParametersHost() const;

  virtual void CopyToHost() { }
};

template <>
const float* LstmAllocator<float>::ExpectedOutputHost() const {
  static const std::vector<float> v(EXPECTED_OUTPUT.begin(),
                                    EXPECTED_OUTPUT.end());
  return v.data();
}

template <>
const double* LstmAllocator<double>::ExpectedOutputHost() const {
  return EXPECTED_OUTPUT.data();
}

template <>
const float* LstmAllocator<float>::ExpectedGradInputHost() const {
  static const std::vector<float> v(EXPECTED_GRAD_INPUT.begin(),
                                    EXPECTED_GRAD_INPUT.end());
  return v.data();
}

template <>
const double* LstmAllocator<double>::ExpectedGradInputHost() const {
  return EXPECTED_GRAD_INPUT.data();
}

template <>
const float* LstmAllocator<float>::ExpectedGradParametersHost() const {
  static const std::vector<float> v(EXPECTED_GRAD_PARAMETERS.begin(),
                                    EXPECTED_GRAD_PARAMETERS.end());
  return v.data();
}

template <>
const double* LstmAllocator<double>::ExpectedGradParametersHost() const {
  return EXPECTED_GRAD_PARAMETERS.data();
}

